import React from "react";
import TodoItem from "./Item/TodoItem";
import { BsBookmarkCheck } from "react-icons/bs";

const todos = [
  {
    _id: "23",
    title: "finish yor homework",
    isCompleted: false,
  },
  {
    _id: "233",
    title: "wash dishes",
    isCompleted: false,
  },
  {
    _id: "243",
    title: "watch TV",
    isCompleted: false,
  },
];
const Home = () => {
  return (
    <div className="Home">
      {todos.map((todo) => (
        <TodoItem key={todo._id} todo={todo} className="text-blue-900" />
      ))}
      <BsBookmarkCheck size={74} className="text-blue-900" />
    </div>
  );
};
export default Home;
